import React from 'react';
import { Navbar, Nav } from "react-bootstrap";
import Container from 'react-bootstrap/Container';

function Header({ handleNavigationClick }) {
  return (
    <header>
      <Navbar className='bg-body-tertiary'>
        <Container>
          <p>Navbar container</p>

        </Container>
      </Navbar>
      <nav>
        <ul>
          <li onClick={() => handleNavigationClick('projects')}>Projects</li>
          <li onClick={() => handleNavigationClick('about')}>About</li>
          <li onClick={() => handleNavigationClick('contact')}>Contact</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
